  selector: 'app-wiki-sidebar-nav',
  templateUrl: './w-sidebar.component.html',
  styleUrls: ['./w-sidebar.component.scss']
})
export class WSidebarComponent {

}
<div class="w-sidebar-container_secctions">
  <div class="container-fluid">
    <div class="row">
      <div class="col-12 text-center">
        <img class="img-fluid mt-2" src="../../../../../assets/img/wikilogo.svg">
